import React from "react";
import { useNavigate } from "react-router-dom";
import "./DscPage.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faFileSignature } from "@fortawesome/free-solid-svg-icons";

// Card Component: Reusable component for displaying card content
const Card = ({ title, description, onClick, icon }) => (
  <div className="transparent-card">
    <div className="transparent-card-header">
      {icon && <span className="card-icon">{icon}</span>} {/* Display icon if provided */}
      <span>{title}</span>
    </div>
    <div className="transparent-card-content">
      {description}
    </div>
    <div className="transparent-card-footer">
      <button className="btn-primary" onClick={onClick}>More</button>
    </div>
  </div>
);

// DscPage Component: Main page for displaying DSC options
const DscPage = () => {
  const navigate = useNavigate();

  return (
    <div className="dsc-page">
      <header className="header">
        {/* Optional navigation */}
      </header>
      <main className="main">
        <section className="hero">
          {/* <h1>Explore Our <span>DSC</span> Service</h1> */}
          <div className="cards">
            {/* <Card 
              title="DSC" 
              description="Get your Digital Signature Certificate for India and foreign use, handled by our professionals."
              icon={<FontAwesomeIcon icon={faFileSignature} />} 
              onClick={() => navigate("/consulting-page")} 
            /> */}
            {/* Card for Indian DSC with specific details */}
            <Card 
              title=" DSC"
              description="Obtain your Digital Signature Certificate for use in India,foregin guided by our experts."
              icon={<FontAwesomeIcon icon={faFileSignature} />} 
              onClick={() => navigate("/dsc-india")} 
            />
          </div>
          <button className="go-back-btn" onClick={() => navigate("/")}>Go back</button>
        </section>
      </main>
    </div>
  );
}

export default DscPage;
